import React, {useState} from 'react'
import Submit from 'Submit'

function App(){
	const [finaldata, setfinaldata]=useState(); 
	
	const adding =(daa) =>{
		daa.id = Math.random();
		setfinaldata({daa, finaldata})
		console.log(finaldata);
	}
	
	
	return(
	
	<Submit adding={adding}/>
	)
	
	
}
export default App
